★「脈拍」もGPS情報も、すべて、その腕に！エプソンのスポーツウォッチ！！<br>
<br>
●エプソンの技術を集結させた、高精度脈拍センサーを搭載！！<br>
●血中のヘモグロビンが光を吸収する性質を利用して、手首の血管にＬＥＤ光を照射！血流の変化で脈拍数を毎秒計測します！！<br>
●ランニング時の高速走行の動きにも対応し、心拍計測のために以前のような胸ベルト（ハートレートセンサー）を装着する煩わしさが無く、脈拍を腕で検知します！！<br>
●ＧＰＳ機能に関しても国産準天頂衛星「みちびき」に対応し、電波が高い建物などに遮られにくく正確な測位が可能！！<br>
●ＧＰＳ信号が入りにくいトンネルやジム内でもストライドセンサーを内臓しているため高精度で距離やラップを刻み続けます！！<br>
●計測データはPC・スマホでWebアプリ「NeoRun」にアップロードして管理！軌跡の地図表示や速度・距離などの走行データに加え、脈拍数も管理できるので、より緻密にトレーニングを振り返り可能！！<br>
<br>
■企画製造販売元 セイコーエプソン株式会社<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
