★アディダスのtakumiシリーズソックス！<br>
<br>
●『シューズだけが走る武器ではない』シューズの匠・三村仁司氏と共同開発したソックス！<br>
●足の形に合わせたフィット感と摩擦の熱を逃がす吸汗速乾性・通気性に優れたメッシュ構造が特徴！<br>
●トップランナーの走り方に着目！前足～中足部で接地する際のブレを抑えるグリップ配置で蹴り出しをサポート！<br>
●日本人ランナーを速くするために生まれたソックス！adizero takumiシューズと合わせて是非お使いください！<br>
<br>
■素材 ポリエステル、綿、その他<br>
■企画製造販売元 アディダスジャパン株式会社<br>
<br>
